import React from 'react';
import {
  Box,
  Typography,
  Grid,
  Card,
  CardContent
} from '@mui/material';
import Slider from 'react-slick';
import AgricultureIcon from '@mui/icons-material/Agriculture';
import YardIcon from '@mui/icons-material/Yard'; // Semilla
import StoreIcon from '@mui/icons-material/Store'; // Fruta
import HandymanIcon from '@mui/icons-material/Handyman'; // Herramienta
import PetsIcon from '@mui/icons-material/Pets'; // Ganado
import LocalDiningIcon from '@mui/icons-material/LocalDining'; // Verdura
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

export default function PantallaInicio() {
  const secciones = [
    {
      imagen: '/imagenes/carrusel1.jpg',
      titulo: 'Ganadería responsable para alimentar al mundo',
      subtitulo: 'Cuidamos cada paso del proceso productivo'
    },
    {
      imagen: '/imagenes/carrusel2.jpg',
      titulo: 'La naturaleza nos da vida, nosotros la protegemos',
      subtitulo: 'Cultivamos con respeto por la tierra'
    },
    {
      imagen: '/imagenes/carrusel3.jpg',
      titulo: 'Sembramos futuro con cada semilla',
      subtitulo: 'Innovación desde el inicio del ciclo productivo'
    },
    {
      imagen: '/imagenes/carrusel4.jpg',
      titulo: 'Frutas frescas, sabor natural directo del campo',
      subtitulo: 'Calidad agrícola para todos'
    }
  ];

  const divisiones = [
    { nombre: 'Fruta', color: '#FF7043', icono: <StoreIcon fontSize="large" /> },
    { nombre: 'Verdura', color: '#4CAF50', icono: <LocalDiningIcon fontSize="large" /> },
    { nombre: 'Semilla', color: '#009688', icono: <YardIcon fontSize="large" /> },
    { nombre: 'Herramienta', color: '#607D8B', icono: <HandymanIcon fontSize="large" /> },
    { nombre: 'Ganado', color: '#8BC34A', icono: <PetsIcon fontSize="large" /> }
  ];

  const settings = {
    dots: true,
    infinite: true,
    autoplay: true,
    autoplaySpeed: 4000,
    arrows: false,
    pauseOnHover: false
  };

  return (
    <Box sx={{ width: '100%', mt: 2 }}>
      {/* 🌾 Carrusel tipo Agripac */}
      <Slider {...settings}>
        {secciones.map((item, index) => (
          <Box
            key={index}
            sx={{
              position: 'relative',
              height: '60vh',
              backgroundImage: `url(${item.imagen})`,
              backgroundSize: 'cover',
              backgroundPosition: 'center',
              overflow: 'hidden'
            }}
          >
            <Box
              sx={{
                position: 'absolute',
                inset: 0,
                backgroundColor: 'rgba(0, 0, 0, 0.35)',
                zIndex: 1
              }}
            />
            <Box
              sx={{
                position: 'absolute',
                top: 40,
                left: 60,
                zIndex: 2,
                color: '#fff',
                maxWidth: '60%'
              }}
            >
              <Typography
                variant="h4"
                sx={{ fontWeight: 'bold', textShadow: '2px 2px 4px #000' }}
              >
                {item.titulo}
              </Typography>
              <Typography
                variant="h6"
                sx={{ mt: 1, textShadow: '1px 1px 3px #000' }}
              >
                {item.subtitulo}
              </Typography>
            </Box>
          </Box>
        ))}
      </Slider>

      {/* 🧭 Divisiones alargadas y redondeadas estilo Agripac */}
      <Box sx={{ px: 4, py: 6 }}>
        <Typography
          variant="h4"
          sx={{ fontWeight: 'bold', mb: 4 }}
          align="center"
        >
          Nuestras Divisiones
        </Typography>

        <Grid container spacing={3}>
          {divisiones.map((div, index) => (
            <Grid item xs={12} key={index}>
              <Card
                sx={{
                  backgroundColor: div.color,
                  color: '#fff',
                  borderRadius: 3,
                  display: 'flex',
                  alignItems: 'center',
                  boxShadow: 3,
                  height: '80px',
                  px: 3,
                  '&:hover': {
                    transform: 'scale(1.01)',
                    transition: '0.3s'
                  }
                }}
              >
                {div.icono}
                <CardContent sx={{ ml: 2 }}>
                  <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
                    {div.nombre}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Box>
    </Box>
  );
}
